import './addVideo.css'
function AddVideo({setVideo,video}) {

    const obj = {
        id: video.length + 1,
        title: 'React tutorial',
        channelName: 'Nurmagomedov',
        isVerified: true,
        view: '12M',
        time: '2 years ago',
    }

    function VideoAdd() {
        setVideo(obj)
    }

    return (
        <button onClick={() => VideoAdd()} className="add-btn">add Video</button>
    )
}

export default AddVideo;
